INSERT INTO `blog_posts` (`postID`, `postTitle`, `postDesc`, `postCont`, `postDate`, `filename`, `filedata`, `mimetype_id`) VALUES
(2, 'Private Odysseus moon lander reveals which Earth ', 'Astrophysicist Jack Burns of the University of Colorado Boulder described the moment as the \"dawn of radio astronomy from the moon.\"', 'Human technology like cell phones and broadcast towers constantly radiate radio waves into space, and astronomers estimate this tell-tale signature of humanity has swept across 75 nearby star systems, signaling to any watchful alien civilization that Earth hosts a technologically advanced species. And, while scientists have listened to the incessant radio chatter from our planet for a long time, in late February, they heard it from the moon for the first time.\r\n<br>\r\n<br>\r\nA small radio telescope onboard the Odysseus spacecraft, the first commercial vehicle that successfully landed on the moon on Feb. 22, recorded radio waves beamed from Earth for 1.5 hours. The experiment, named ROLSES, made its observations from Odysseus\' landing spot near the Malapert A crater, which sits roughly 185 miles (297 kilometers) away from the moon\'s south pole.\r\n<br>\r\n<br>\r\nAstrophysicist Jack Burns of the University of Colorado Boulder, who is the co-investigator of ROLSES, described the moment as the \"dawn of radio astronomy from the moon.\" By studying Earth as an exoplanet, astronomers hope to search for similar fingerprints coming from planets around other stars, which would be a potential sign of intelligent life.\r\n\r\n', '2023-02-09 05:29:03', 'space-shuttle.png', , 1);
INSERT INTO `blog_posts` (`postID`, `postTitle`, `postDesc`, `postCont`, `postDate`, `filename`, `filedata`, `mimetype_id`) VALUES
(4, 'Life after stellar death? How life could arise on planets orbiting white dwarfs', 'Transits of exoplanets in front of their white dwarf host stars could reveal the presence of water.\r\n\r\n\r\n', 'Planets could survive the death of their star and become capable of supporting life — and now astronomers are going to go hunting for them.\r\n<br>\r\n<br>\r\nStars do not survive forever, the sun included. In about five billion years, Earth\'s star will begin to exhaust its supply of hydrogen used to generate energy via nuclear fusion in its core. The sun\'s core will then begin to contract, increasing the temperature so that hydrogen in its outer envelope can then ignite fusion reactions that will cause the sun — and other stars like it, when they reach this stage — to expand into a red giant.\r\n<br>\r\n<br>\r\nThe red giant phase is bad news for any planets nearby. In our solar system, the expanding sun will swallow up Mercury, Venus and probably Earth, too.  ', '2023-02-09 05:31:19', 'satellite.png', , 1);
INSERT INTO `blog_posts` (`postID`, `postTitle`, `postDesc`, `postCont`, `postDate`, `filename`, `filedata`, `mimetype_id`) VALUES
(11, 'If alien life exists on Europa, we may find it in hydrothermal vents', 'If there\'s life on Europa or Enceladus, it could have a network of deep-sea hydrothermal vents to thank for its existence.', 'Low-temperature hydrothermal vents could survive on the dark ocean floors of moons like Jupiter\'s Europa for potentially billions of years, new computer simulations have shown, as astrobiologists strive to figure out whether these alien oceans could be habitable.\r\n<br>\r\n<br>\r\nHydrothermal vents are both a source of chemical energy and heat, and are one of the possible locations for the origin of life on Earth. Planetary scientists have theorized that hydrothermal vents at the bottom of the oceans beneath the ice on moons of Jupiter like Europa and Ganymede, and the Saturn satellite Enceladus, could help warm those oceans and kickstart the biochemistry of life.\r\n<br>\r\n<br>\r\nThe problem is that modeling of these vents has focused on the extremely high-temperature ones — the \"black smokers\" powered by volcanic activity. While these super-hot vents can siphon energy from Earth\'s hot core, the icy moons do not have hot cores, meaning there\'s been a question mark over whether such vents could survive long enough to create the long-term conditions for life. \r\n\r\n', '2023-10-26 13:09:27', 'galaxy.png', , 1);
INSERT INTO `blog_posts` (`postID`, `postTitle`, `postDesc`, `postCont`, `postDate`, `filename`, `filedata`, `mimetype_id`) VALUES
(14, 'Area 51: What is it and what goes on there?', 'Area 51 is synonymous with tales of UFOs, government cover-ups and potentially testing alien technology.', 'Located at Groom Lake in the desolate desert of southern Nevada, Area 51 is a U.S. Air Force installation notorious for its rumored connection with unidentified flying objects (UFOs). \r\n<br>\r\n<br>\r\nConspiracy theories claim the base is used to test alien technology allegedly recovered from crash sites, such as the well-known incident in Roswell, New Mexico. These theories are fueled by the base\'s long-standing secrecy and its continued inaccessibility to the public. \r\n<br>\r\n<br>\r\nConsequently, this assuming military facility has become an intrinsic part of the modern mythology and urban legends of the 20th century, with a large influence on media and pop culture. ', '2024-06-30 04:07:24', 'constellation.png', , 1);
INSERT INTO `blog_posts` (`postID`, `postTitle`, `postDesc`, `postCont`, `postDate`, `filename`, `filedata`, `mimetype_id`) VALUES
(21, 'If alien terraforming emits greenhouse gases, our telescopes could detect it', 'You wouldn\'t need extra effort to look for these technosignatures, if your telescope is already characterizing the planet for other reasons — and it would be jaw-droppingly amazing to find them', 'If aliens wrap their planets in potent greenhouse gases like we do, we\'d be able to tell.\r\n<br>\r\n<br>\r\nThat\'s according to a recent thought experiment in which scientists identified five \"artificial\" greenhouse gases that, if abundant enough, can be spotted in the atmospheres of certain exoplanets using existing technology, including the James Webb Space Telescope (JWST). \r\n<br>\r\n<br>\r\nThe gases, which include fluorinated versions of methane, ethane, propane, on Earth are known to be some of the most potent and persistent heat-trapping gases emitted by humans during various industrial manufacturing processes, like those used to produce semiconductors, for instance. Because these substances don\'t naturally form in large quantities — if we\'re going by Earth chemistry, at least — spotting them in an exoplanet\'s air would signal the presence of technologically-advanced species, scientists say.', '2024-08-23 09:32:52', 'saturn.png', , 1);
INSERT INTO `blog_posts` (`postID`, `postTitle`, `postDesc`, `postCont`, `postDate`, `filename`, `filedata`, `mimetype_id`) VALUES
(22, 'The great silence: Just 4 in 10,000 galaxies may host intelligent aliens', 'If plate tectonics, oceans and continents are rare on worlds throughout the universe, that is.', 'Alien life capable of communicating across interstellar space might not be able to evolve if its home planet doesn\'t possess plate tectonics, not to mention just the right amount of water and dry land.\r\n<br>\r\n<br>\r\nPlate tectonics are absolutely essential if complex life is to evolve, argue Robert Stern of the University of Texas at Dallas and Taras Gerya of ETH Zurich in Switzerland. On Earth, complex multicellular life appeared during a period known as the Cambrian explosion, 539 million years ago.\r\n<br>\r\n<br>\r\n\"We believe that the onset of modern-day-style plate tectonics greatly accelerated the evolution of complex life and was one of the major causes of the Cambrian explosion,\" Gerya told Space.com.\r\n\r\n', '2024-08-23 09:37:10', 'anm31.png', , 1);
INSERT INTO `blog_posts` (`postID`, `postTitle`, `postDesc`, `postCont`, `postDate`, `filename`, `filedata`, `mimetype_id`) VALUES
(23, 'What if life on Venus is just life from Earth?', 'What if there was life, but it\'s transferred from Earth because there\'s already life here?', 'When an asteroid strikes, there\'s typically at least one undeniable outcome: an asteroid mess. The most obvious part of this mess tends to come in the form of a nice and cinematic crater, but there\'s also a second part. It\'s called the \"ejecta,\" and represents all the stuff that gets punched up off the ground when the impact happens — and things get a little weird when we start thinking about where those ejecta particles go.\r\n<br>\r\n<br>\r\nHow far can they get? Can they shoot 10 miles upward? 100 miles? 1,000 miles? Those aren\'t very far-fetched possibilities, considering how utterly teensy such particles can be. But, is there a limit? Well, maybe, but before hitting that limit, some scientists argue that the particles could get unfathomably far — like, all the way to another planet far. And, as if that weren\'t interesting enough, one crew is also thinking about what this ejecta can hold.\r\n<br>\r\n<br>\r\nEarth ejecta, for instance, could hold Earth life.\r\n\r\n\r\n', '2024-08-23 09:39:46', 'astronaut.png', , 1);
INSERT INTO `blog_posts` (`postID`, `postTitle`, `postDesc`, `postCont`, `postDate`, `filename`, `filedata`, `mimetype_id`) VALUES
(24, 'NASA wants a \'Super-Hubble\' space telescope to search for life on alien worlds', 'The question \'Are we alone?\' is one of the most significant questions, not just in the history of science, but in the history of humanity.', 'NATIONAL HARBOR, Md. — When a boy named Elliott found an alien in the classic 1982 film \"E.T.\" it offered easy answer to the question on every astronomer\'s mind: Are we alone in the universe? In reality, however, scientists have yet to solve that query.\r\n<br>\r\n<br>\r\nThat could soon change, thanks to a new NASA flagship telescope being designed to seek out strange new worlds that could support life as we know it. Called the Habitable Worlds Observatory, the telescope is so massive it may even need to ride a next-gen megarocket like SpaceX\'s Starship to reach space; it will also require new technological innovations to hunt for Earth\'s twin across the light-years. Yet, even with such hefty demands, this project was tapped as a top priority for NASA in the Decadal Survey on Astronomy and Astrophysics 2020 (Astro2020), an influential report that aims to set a roadmap for the astronomy community within the decade following its release.\r\n<br>\r\n<br>\r\n\"The question \'Are we alone?\' is one of the most significant questions, not just in the history of science, but in the history of humanity, and we are at the precipice of actually having the tools and technologies that are required to tackle this question in a rigorous and scientific fashion,\" Giada Arney, the interim project scientist for the Habitable Worlds Observatory, told a crowd of scientists during a plenary talk here at the 245th American Astronomical Society meeting on Wednesday (Jan. 15). \"We might learn the answer to this question within our lifetimes, and the answer to that question is a discovery, the implications of which would ripple through future millennia.\"\r\n\r\n', '2024-08-23 09:42:15', 'space.png', , 1);
INSERT INTO `blog_posts` (`postID`, `postTitle`, `postDesc`, `postCont`, `postDate`, `filename`, `filedata`, `mimetype_id`) VALUES
(36, 'DJI Flip drone review', 'The DJI Flip is an innovative beginner drone with vlogging, selfie and camera drone functionality making it similar to the DJI Neo but more advanced.', 'Since the launch of the DJI Neo, which is extremely similar to the HoverAir X1 Pro and its still available predecessor, the HoverAir X1, the world\'s leading drone manufacturer has begun to take beginner drones in a new direction. The DJI Flip is the latest beginner model to hit the shelves, and this vlogging drone delivers intelligent flight modes alongside camera drone functionality.\r\n<br>\r\n<br>\r\nWith this level of versatility alongside an attractive base kit price of $439/£369, the Flip will likely appeal to beginner and enthusiast drone pilots. This is a drone that will undoubtedly take a place among the best beginner drones considering all this alongside the unique folding design of the Flip, where safety is paramount.\r\n<br>\r\n<br>\r\nMoving back to the design, which is one of the most eye-catching aspects of the Flip, there\'s no way you\'ll have seen a drone like this before. The four propellers are encased in lightweight propeller guards for safer flights when tracking you. These fold down below the airframe and when folded out, make the Flip a much larger drone, but within the regulator-friendly sub-250g category', '2024-09-11 16:27:04', 'rocket.png', , 1);
INSERT INTO `blog_posts` (`postID`, `postTitle`, `postDesc`, `postCont`, `postDate`, `filename`, `filedata`, `mimetype_id`) VALUES
(39, 'Space Force', 'In case you forgot it was still up there.', 'That U.S. Space Force X-37B Orbital Test Vehicle (OTV-7) has silently slipped past one-year of flight time.\r\n<br>\r\n<br>\r\nThe craft is engaged in performing aerobrake maneuvers, a technique to alter its orbit around Earth, as well as safely dispose of its attached service module.\r\n<br>\r\n<br>\r\nLofted in December of 2023, the military spaceplane was placed in an orbit higher than any of the earlier space plane missions – into a highly elliptical high Earth orbit.\r\n\r\n\r\n', '2025-01-17 08:01:44', 'space-exploration.png', , 1);
INSERT INTO `blog_posts` (`postID`, `postTitle`, `postDesc`, `postCont`, `postDate`, `filename`, `filedata`, `mimetype_id`) VALUES
(40, 'Our warming Earth: 2024 was hottest year on record, NASA says', 'Once again, the temperature record has been shattered — 2024 was the hottest year since record keeping began in 1880.', 'Scientists have largely attributed this temperature rise to the increase of greenhouse gases, including carbon dioxide and methane, in Earth\'s atmosphere since the Industrial Revolution. In the pre-industrial days of the 18th century, the carbon dioxide level in the atmosphere was approximately 278 parts per million (ppm). Today, it\'s 420 ppm.\r\n<br>\r\n<br>\r\nBut there are likely other influences on 2024\'s temperature rise, too. NASA noted that a particularly strong El Niño — a natural climate fluctuation — that began in fall 2023 likely pushed the average temperature up in 2024. Plus, scientists are still studying the effects of events like the January 2022 Tonga volcanic eruption, which introduced vast quantities of water vapor and sulfur dioxide into the atmosphere.', '2025-01-17 08:02:56', 'earth.png', , 1);

